import React from 'react';

function DoctorCard({ name, specialty, image, onEdit }) {
  return (
    <div className="bg-white border rounded-lg p-4 text-center">
      <img
        src={image}
        alt={name}
        className="w-20 h-20 mx-auto rounded-full mb-4"
      />
      <h3 className="text-lg font-medium">{name}</h3>
      <p className="text-gray-500">{specialty}</p>
      <div className="flex justify-center gap-2 mt-4">
        <button className="px-4 py-1 bg-red-500 hover:bg-red-800 text-white rounded-full">Remove</button>
        <button
          className="px-4 py-1 bg-gray-300 hover:bg-gray-500 text-gray-800 rounded-full"
          onClick={onEdit} // Trigger the edit functionality
        >
          Edit
        </button>
      </div>
    </div>
  );
}

export default DoctorCard;
